import React from "react";

function TheTable({ grade }) {
  return (
    <div className="gr grade1">
      <h1>{grade}학년</h1>
      <button>추가</button>
      <button>삭제</button>
      <button>저장</button>

      <table width={1000} border={1}>
        <thead style={{ backgroundColor: "#00796B", color: "#ffffff" }}>
          <tr>
            <th>이수</th>
            <th>필수</th>
            <th>과목명</th>
            <th>학점</th>
            <th>출석점수</th>
            <th>과제점수</th>
            <th>중간고사</th>
            <th>기말고사</th>
            <th>총점</th>
            <th>평균</th>
            <th>성적</th>
          </tr>
        </thead>
        <tbody>{/* {tableRows} */}</tbody>
        <tfoot>{/* {footerContent} */}</tfoot>
      </table>

      {/* <TableModal
          numRows={grade1Rows}
          tableModalRef={tableModalRef}
          addRow={() => addRow(1)}
        ></TableModal> */}
    </div>
  );
}

export default TheTable;
